import React, {Component} from 'react';
import './App.css';

import {
    HashRouter,
    Route,
    Link,
    Switch,
    NavLink,
} from 'react-router-dom';

class App extends Component {

    render() {
        return (
            <HashRouter>
                <Switch>
                    <Route exact path='/' component={MainPage}/>
                    <Route exact path='/watch_online' component={WatchOnline}/>
                    <Route exact path='/polecane' component={Recommended}/>
                </Switch>
            </HashRouter>
        );
    }
}

export default App;
